import './App.css';
import { ThemeProvider, Container } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';
import Banner from './components/Banner';
import { theme } from './theme';

function App() {

  return (
    <ThemeProvider theme={theme}>
      <Banner />
    </ThemeProvider>
  );
}

export default App;
